  true,\n\t\"url\": null,\n\t\"notes\": \"<p>This dataset is a collection of the submitted
  activities and projects from member of the Cross Federal Workgroup on Telehealth
  (FedTel). The FedTel's membership comprises agencies and offices across the Federal
  government with an interest or investment in telehealth. The Workgroup was launched
  in April 2011 with the assistance of the White House Office of Science &amp; Technology
  Policy. The workgroupu2019s goal is to facilitate info sharing/education among its
  members, coordinate guidance and other programmatic materials, and explore opportunities
  for joint funding.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
